import React from 'react';
import nav from '../styles/Nav.module.css';

const Nav = () => {
  return (
    <nav className={nav.main}>
      <ul>
        <li><i class="fas fa-bars"></i></li>
        <li>Houses</li>
        <li>9</li>
      </ul>
    </nav>
  )
}

export default Nav;
